(window.webpackJsonp=window.webpackJsonp||[]).push([[28],{376:function(n,t,e){"use strict";e.r(t);var o=e(21),r=Object(o.a)({},(function(){var n=this,t=n.$createElement,e=n._self._c||t;return e("ContentSlotsDistributor",{attrs:{"slot-key":n.$parent.slotKey}},[e("h2",{attrs:{id:"以前的一些日记2020-7"}},[e("a",{staticClass:"header-anchor",attrs:{href:"#以前的一些日记2020-7"}},[n._v("#")]),n._v(" 以前的一些日记2020.7")]),n._v(" "),e("p",[n._v("::: password\n2020.7.20\n今天按照约定和女友一起锻炼，我监督他做瑜伽动作，矫正她的高低肩和长短腿问题（也不是什么大的问题），一共做了30多分钟，出了一点汗，今天就到这里为止了，明天继续。昨天和闫帅栋讨论了要学的技术，以及android开发的前景，听他说，韩老师也觉得android开发市场饱和了，但通过查阅文章，我发现实际上不然，饱和的永远是一般的码农，对于高级人才，android乃至各行各业都是急需的，我需要做的不是一味的学习新的框架，新的语言，我要做的是了解语言背后的原理，我要做的是学习计算机的一些不变的东西，例如数学、计算机组成原理，编译原理，高等数学，这些是不变的东西，这些是以不变应万变的东西，掌握了不变的东西，就能更快更深刻的理解表面浅层次的编程语言背后的工作原理，在理解的基础上学习新的技术，能够节省很多时间，理解更加透彻，越是枯燥的东西，越是接近真理的东西，因为那是去除了雕饰和浮华而留下的本质的东西，就像去除了肉的骨头一样，硬骨头难啃，但硬骨头更是浓缩的精华，我不仅要啃，还要咬碎了咽下去去，吃得苦中苦，方为人上人。人类社会，我只能在竞争中尽量保持自己的好奇心，做自己想做的事。")]),n._v(" "),e("p",[n._v("2020.7.21\n十个程序员必备的网站推荐：\n程序员的工作和日常生活非常的枯燥，这里给大家推荐一些程序员经常使用的网站，也是我经常上的一些网站，尤其是前三个网站感觉用起来非常的舒服。我大致把这些网站分为三类，使用工具类，设计分享类，资讯交流类，业界良心类。希望能对大家有所帮助。\n　　1，Github代码托管（https://github.com/）\n　　作为开源代码库以及版本控制系统，Github拥有140多万开发者用户。随着越来越多的应用程序转移到了云上，Github已经成为了管理软件开发以及发现已有代码的首选方法。代码托管必备。\n　　2，Dribbble设计达人（https://dribbble.com/）\n　　Dribbble是一个面向创作家、艺术工作者、设计师等创意类作品的人群，提供作品在线服务，供网友在线查看已经完成的作品或者正在创作的作品的交流网站。对于前端设计来说真是再好不过的一个网站了。\n　　3，StackOverFlow技术问答（http://stackoverflow.com/）\n　　Stack Overflow是一个与程序相关的IT技术问答网站。用户可以在网站免费提交问题，浏览问题，索引相关内容，在创建主页的时候使用简单的HTML。在问题页面，我们不会弹出任何广告，销售信息，Java 窗口等。\n　　4，全球最大中文IT社区（http://www.csdn.net/）\n　　中国最大的IT社区和服务平台，为中国的软件开发者和IT从业者提供知识传播、职业发展、软件开发等全生命周期服务，满足他们在职业发展中学习及共享知识和信息、建立职业发展社交圈、通过软件开发实现技术商业化等刚性需求。\n　　5，博客园（http://www.cnblogs.com/）\n　　这样一个不起眼的地方，却吸引了很多IT技术精英，把这里当作自己的网上家园，每天在这里分享着精彩的原创内容，也许他们看重的不是华丽的外表、诱人的虚名，而是纯净、专注、对技术人员的理解。\n　　6，V2EX（http://www.v2ex.com/）\n　　无论你是在大学进行人生最重要阶段的学习，或者是在中国的某座城市工作，或者是在外太空的某个天体如 Sputnik 1 上享受人生，在注册进入 V2EX 之后，你都可以为自己设置一个所在地，从而找到更多和你在同一区域的朋友。\n　　7，程序员客栈（http://www.proginn.com）\n　　我们都知道，未来是互联网科技从业者的，更确切的说是属于程序员、设计师、产品经理的...因此，我们需要一个地方让这些人立体展现自我成就，建立影响力，输出价值，拓展机遇。同时我们帮助企业团队找到行业里最优秀的人才，解决难题。\n　　8，码农网（http://www.codeceo.com/）\n　　程序员编程资料和编程经验分享平台码农网是一个专注程序员编程资料、编程经验、职场面试分享的博客平台,帮助程序员在编程开发中获取第一手的实用资料\n　　9，果壳网（http://www.guokr.com/）\n　　作为一个开放、多元的泛科技兴趣社区，吸引了百万名有意思、爱知识、乐于分享的年轻人聚集在这里，用知识创造价值，为生活添加智趣。在这里可以关注感兴趣的人，阅读他们的推荐，也将有意思的内容分享给关注的人；依兴趣关注不同的小组，精准阅读喜欢的内容，并与网友交流；在“果壳问答”里提出困惑你的科技问题，或提供靠谱的答案。\n　　10，1024（你懂的）\n　　业界良心，你懂的！")]),n._v(" "),e("p",[n._v("较出名的国外程序员论坛：\nStack Overflow\nStack Overflow 是全球最受程序员欢迎的开发社区\n官方网站：\nhttp://stackoverflow.com/\nReddit\nReddit是一个用户粘性比较强的开放社区，编程开发板块只是其中的一小部分。\n官方网站：\nhttp://www.reddit.com/r/programming\nGoogle+Communities\n加入Google+社区只需要一个Google账户即可，你可以完全免费的获取里面的资源。\n官方网站：\nhttps://plus.google.com/communities\nSitePoint\nSitePoint主要目标是帮助初学者了解其选择的编程语言和技术，并且得到相应的提高。\n网站内容包括web开发、Web设计、技术写作以及用户体验等。\n官方网站：\nhttp://www.sitepoint.com/forums/\nCodeProject\ncodeproject侧重软件开发，比如C C# C++ Java Lisp等开发。\n官方网站：\nhttp://www.codeproject.com/\nHacker News\n可以实时看到编程界中发生的任何事情，包括一些学习的资源和教程。\n官方网站：\nhttps://news.ycombinator.com/news\nBytes\nBytes是一个传统的开发社区，新手和专家都可以在里面讨论一些关于软件开发、数据库开发以及网络和系统管理的问题。\n数据库、网络以及系统是编程的基础，我们需要关注这方面的问题，从而能更好的帮助我们提高编程能力。\n官方网站：\nhttp://bytes.com/\nDaniWeb\nDaniWeb以前是专为市场营销业务分析人员设计的，但是现在主要为各个年龄段的Web开发者和程序员服务。\n官方网站：\nhttp://www.daniweb.com/\nDream In Code\n这几年，它的更新比较缓慢了，这有好的一面也有坏的一面，60w的用户以及百万级的文章，内容涵盖Java C++ VB.NET 等，学习资源相当丰富。\n官方网站：\nhttp://www.dreamincode.net/forums/\nTech.Pro\nTech.pro是一个关注科技领域发展的相关资讯的社区，Tech.pro是一个获取资源和教程的入门网站，包含一些技术教程、讨论、博客以及链接等。\n官方网站：\nhttp://tech.pro/\nPineapple\n也许这还算不上活跃的优秀开发社区，但是这里也包含很多有用的工具、教程以及类库资源等。\n官方网站：\nhttp://pineapple.io/\nLobsters\n这是一个用户邀请制的开发社区，是一个真正“面向社交”的社区，你可以在里面找到大量的关于编程的任何讨论，很多信息都至少有20多条回帖，这些信息或许对你会有很大帮助。\n官方网站：\nhttps://lobste.rs/")]),n._v(" "),e("p",[n._v("2020.7.25\n现在已经是凌晨12点39，昨晚又是罪恶的，我又撸了，我深深的知道这是不好的，刷完牙，我又吃了水果和老姐给我的一个糖，口感不错，入口即化的赶脚。今天下午出去转了一圈，想看看有没有要服务员的，结果清一色的都是要长期工，回家我果断知乎了一下“大学生暑假是打工还是自学”,答案让我欣慰：当然是学习啦！！打工是为了锻炼自己的胆量和人说话的技巧，长长见识 ，我觉得更主要的是吃吃苦，体会一下挣钱的不容易吧，这样就会更加努力的学习了吧，我妈应该是这个意思吧。但我觉得还是要在家多多学学计算机方面的知识，也学习其他方面的知识，在现在这个时期比较重要，等到以后工作了就没有这么多时间学习乱七八糟的东西了，关键是没有精力了，如果是想让我分担一下家里的经济，不差这几年，不差这几千，现在 就是积累的时期，有了技术，有了扎实的专业知识，就会吸引和你一样强大的 人，我要做的就是不断地提升自己，变得更强，其他的不要花费过多的精力。希望明天一切安好，希望我可以越来越好！！\n哎呀，以前写了好多的日记 都丢掉了，因为我写的字太烂了，自己都不想看，我这个人就是不行，我能写好但是就是不能坚持下来，我知道什么是好的，可是我就是控制不住自己，可能很多人都这样，但是我要是克服不了自己内心的软弱，我就只能成为一个软弱的人，一个软弱的人怎么能保护自己心爱的人呢，振作起来啊，符琦琦，你身上的责任可不少啊，不能再这样下去了，从现在开始要好好学习了，今天要背单词，要学习android开发知识，还要做算法题，看数学书，做菜，洗完拖地，还要下去走走，还要洗个澡，这么多的事情根本没有时间让你放松，你哪里来的力气去做那些猥琐的事情，你要成为坦荡的君子，多想想光明的未来吧，我只想做一个强者，何为强者:never never give up!\n:::\n"),e("password")],1)])}),[],!1,null,null,null);t.default=r.exports}}]);